import React from "react";

import classes from './InterviewList.module.css';

const InterviewList = () => {
    return (
        <div className={classes.container}>
            <article className={classes.article}>
                <h3 className={classes.article_category}>NEWS</h3>
                <h2 className={classes.article_title}>Snow in Turkey</h2>
                <p className={classes.article_excerpt}>Heavy snowstorm in Turkey creates havoc as hundreds of villages</p>
            </article>
        </div>       
    );
};

export default InterviewList;
